import React from "react"

export default function Media() {
    return (
        <div className="social">
            <a href="https://github.com/chloeNgo99" target="_blank"><img className="github" src="./images/github.png" /></a>
            <a href="https://www.instagram.com/chloe.aesthetically" target="_blank"><img className="instagram" src="./images/instagram.png" /></a>
            <a href="https://www.linkedin.com/in/chloe-ngo-a540b3253/" target="_blank"><img className="mail" src="./images/linkedin.png" /></a>
        </div>

    )

}
